// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;
pragma experimental ABIEncoderV2;
contract AircraftMaintenance {
    // Struct to store maintenance record
    struct MaintenanceRecord {
        string aircraftName;
        string partsExchanged;
        uint currentMaintenanceDate; // Unix timestamp for current maintenance date
        uint upcomingMaintenanceDate; // Unix timestamp for upcoming maintenance date
    }

    // Mapping to store maintenance records by aircraft ID
    mapping(uint => MaintenanceRecord[]) public maintenanceRecords;

    // Counter for maintenance record IDs
    uint public recordId;

    // Event emitted when a maintenance record is added
    event MaintenanceRecordAdded(uint indexed id, string aircraftName, string partsExchanged, uint currentMaintenanceDate, uint upcomingMaintenanceDate);

    // Function to add a new maintenance record
    function addMaintenanceRecord(string memory _aircraftName, string memory _partsExchanged, uint _currentMaintenanceDate, uint _upcomingMaintenanceDate) public {
        recordId++;
        maintenanceRecords[recordId].push(MaintenanceRecord(_aircraftName, _partsExchanged, _currentMaintenanceDate, _upcomingMaintenanceDate));
        emit MaintenanceRecordAdded(recordId, _aircraftName, _partsExchanged, _currentMaintenanceDate, _upcomingMaintenanceDate);
    }

    // Function to get all maintenance records for an aircraft by ID
    function getMaintenanceRecords(uint _aircraftId) public view returns (MaintenanceRecord[] memory) {
        return maintenanceRecords[_aircraftId];
    }
    
    // Function to get a specific maintenance record by index for an aircraft ID
    function getMaintenanceRecord(uint _aircraftId, uint _index) public view returns (string memory, string memory, uint, uint) {
        require(_index < maintenanceRecords[_aircraftId].length, "Index out of bounds");
        MaintenanceRecord memory record = maintenanceRecords[_aircraftId][_index];
        return (record.aircraftName, record.partsExchanged, record.currentMaintenanceDate, record.upcomingMaintenanceDate);
    }
}
